import React from "react";
import { NavLink } from 'react-router-dom'

const Home = () => {

    return (

        <div className="box-wrapper">
            {/* <h1> This is Home Page </h1> */}

            <div id="box1">
                30 Days  validity <br/><br/>
                <button id="box-1-id"> <NavLink id="apply-button-cards" to="/apply"> Apply Now </NavLink> </button> 

            </div>

            <div id="box2">
                1 Years validity <br/><br/>
                <button id="box-1-id"> <NavLink id="apply-button-cards" to="/apply"> Apply Now </NavLink> </button>
            </div>
            <div id="box3">
                5 Years validity <br/><br/>
                <input type="submit" id="apply-button-cards" value="Apply Now" />
                
            </div> 

            {/* <input type="submit" name="submit-form" id="submit-button" className="form-submit"
          value="Apply" onClick={postData} /> */}
            {/* <li> <NavLink className="nav-bar" to='/contact'> CONTACT US </NavLink> </li> */}

        </div>
    )
}
export default Home
